シンティアム5000は、次世代の高性能を実現した化学合成のマルチグレード・エンジンオイルです。現在はもちろん、これからの高性能エンジン、特に環境対策機構を搭載した自動車を考慮した最新のILSAC GF-4やAPISM基準を超えるよう開発されました。プレミアム化学合成基油に環境に優しい最新の添加剤を配合。 <br><br>高温となるエンジンで起こりやすいオイルの高濃度化を最小限に抑え、堆積物の抑制に優れ、エンジンの摩耗や損傷を最小限に食い止めます。また、外気温に関わらず安定した性能を実現しています。フォーミュラ1での技術をフィードバックしたシンティアム5000は、燃焼効率に優れた省燃費エンジンオイルです。<br><br>●容量：1リットル ●用途：4サイクルエンジン用（乗用車） ●ベースオイル：化学合成油 ●油種：FULL　SYNTHETIC ●規格/粘度/他：0W40 A3/B3 MB 229.1 SM/ ILSAC GF-4 ※画像イメージは0W30/4L <br><br>4ストロークエンジン用（ガソリン・ディーゼル） <br><br>車検対応品<br><br>ケミカル系/エンジンオイル<tr><td colspan="2">
<center><img src="https://image.rakuten.co.jp/parts/cabinet/design/2017summertire2.jpg" border="0" width="800px"><br>
</td></tr></center>


