テクノシンテーゼ（半化学合成油）。最新の車両、高出力型に適応。ガソリン、ディーゼル、ターボ、NA対応。長距離での走行やストップ＆ゴーの多い強い油性でエンジンの磨耗を防ぎ、エンジンライフを伸ばします。清浄性、耐酸化、耐腐食、耐泡性。 <br>■特長 ：半化学合成、エンジンオイル、耐酸化性、耐摩耗性、耐腐食性、耐泡性 　　■SAE粘度/DOT規格：10W40 　■適合規格：ACEA A3/B3、 API SL/CF 　　■メーカーアプルーバル：MB 229.1　VW500.00/505.00<br>※20L缶そのままでの配送となりますので、運送中による多少のキズ・へこみ等はご了承下さい。　※画像はイメージです。 <br>４ストロークエンジン用（ガソリン・ディーゼル） <br>　<br>ケミカル系/エンジンオイル<tr><td colspan="2">
