自動車用ガソリン/ディーゼルエンジンオイル、化学合成油。耐摩耗性、耐熱性に優れ、一般走行から高速走行に至る過酷な使用からエンジンを保護します。15W50の粘度グレードは過酷な条件においても強い油膜保持能力を持ちエンジンの摩耗を防ぎます。特に欧州車やオイル消費の多い車等幅広くご利用いただけます。 <br>■特長：化学合成 4ストロークエンジンオイル　ガソリン/ディーゼル用 　■SAE粘度/DOT規格：15W50　■適合規格：API SL/CF<br>※20L缶そのままでの配送となりますので、運送中による多少のキズ・へこみ等はご了承下さい。　※画像はイメージです。 <br>４ストロークエンジン用（ガソリン・ディーゼル） <br>　<br>ケミカル系/エンジンオイル<tr><td colspan="2">
