シンティアム3000 5W-40は、高性能エンジンを搭載した車の性能が発揮されるもっとも過酷な状況下でもエンジンを保護し、エンジンの性能を最大限に発揮するマルチグレードの超高性能化学合成油です。 <br><br>フォーミュラ1で使用されるオイル技術のフィードバックやレース、テストでの経験をもとに、高負荷使用での耐久性を向上しつつ優れたエンジン出力の発揮と、エンジン保護の両立を考えて開発されました。さらに選び抜かれた化学合成基油に、最新テクノロジーで開発された添加剤を融合した環境に優しいエコオイルです。<br><br>●容量：1リットル ●用途：4サイクルエンジン用（乗用車） ●ベースオイル：化学合成油 ●油種：FULL SYNTHETIC ●規格/粘度/他：5W40 A3/B3/B4/C3 SM/CF MB 229.3/VW502/505 <br><br>4ストロークエンジン用（ガソリン・ディーゼル） <br><br>車検対応品<br><br>ケミカル系/エンジンオイル<tr><td colspan="2">
