ACEA　A3/B3/B4、API：SL規格と、ディーゼル車に対応したCF規格のみならず、ＶＷ502.00、505.00、MB229.3を取得した100％化学合成オイル。このベースオイル採用によりフリクションロスを低減し、エンジン本来の性能を最大限に発揮し、優れた粘度特性と強力な油膜保持力によりターボエンジンやDOHCエンジンといった高性能エンジンにおいて最上のコンディションを約束します。 <br>5W-40の粘度設定はＶＷやメルセデスベンツなどのヨーロッパ車からストリートチューニングエンジンまで幅広い車種にご使用いただけます。　■特長：100％化学合成 4ストロークエンジンオイル　ガソリン/ディーゼル用 　■SAE粘度/DOT規格：5W40 　■適合規格：API SL/CF ACEA A3/B3/B4  ■メーカーアプルーバル：MB229.3 VW502.00 /505.00<br>※20L缶そのままでの配送となりますので、運送中による多少のキズ・へこみ等はご了承下さい。　※画像はイメージです。 <br>４ストロークエンジン用（ガソリン・ディーゼル） <br>　<br>ケミカル系/エンジンオイル<tr><td colspan="2">
