自動車用ガソリン用エンジンオイル。100％化学合成。近年国産車の省燃費対応型エンジンに対応した高性能エンジンオイルです。API SM、ILSAC GF-4を取得しており、最新の省燃費対応型エンジン搭載の国産車にも適応します。 <br>■特長：100％化学合成、エンジンオイル、省燃費 　■SAE粘度/DOT規格：0W20　■適合規格：API SM、 ILSAC GF-4<br>※20L缶そのままでの配送となりますので、運送中による多少のキズ・へこみ等はご了承下さい。　※画像はイメージです。 <br>４ストロークエンジン用（ガソリン・ディーゼル） <br>　<br>ケミカル系/エンジンオイル<tr><td colspan="2">
