100％化学合成油ベースにより、耐摩耗性、耐熱性に優れ、一般走行から高速走行に至る過酷な使用からエンジンを保護します。5W30の粘度グレードはエンジンスタート時でも素早くエンジン内部までオイルが行き渡り、エンジン内部を保護すると同時に省燃費に貢献します。高性能極圧添加剤の配合により、エンジン内部の摩耗を低減し、エンジンの延命に貢献します。 <br>優れた酸化安定性により、オイルの耐熱性が向上し、粘度上昇を防止し、高い清浄分散性能により、クリーンなエンジン状態を維持します。また、耐腐食性、消泡性に優れます。　■特長：100％化学合成 4ストロークエンジンオイル　ガソリン/ディーゼル用 　■SAE粘度/DOT規格：5W30 ■適合規格：API SM/CF GF-4<br>※20L缶そのままでの配送となりますので、運送中による多少のキズ・へこみ等はご了承下さい。　※画像はイメージです。 <br>４ストロークエンジン用（ガソリン・ディーゼル） <br>　<br>ケミカル系/エンジンオイル<tr><td colspan="2">
