ヨーロッパ車向けガソリン/ディーゼルエンジン用。特に高出力の最新モデルの車輌への使用に最適。OPEL/GM Diesel LL B-025の要求する高HTHS粘度と低蒸発性を満足し、オイル消費の低減に貢献する100％化学合成油。高い清浄分散性能を要求するACEA B4に適合し、また高い清浄分散性と省燃費性能を要求するMB229.3に適合し、MB社指定のドレインインターバルに対応します。 <br>■特長：100％化学合成 4ストロークエンジンオイル　ガソリン/ディーゼル 　■SAE粘度/DOT規格：5W40　■適合規格：API SL/CF ACEA A3/B3/B4 　■メーカーアプルーバル：VW 502.00/505.00　 BMW LongLife-98　PORSCHE　Mercedes Benz 229.3　OPEL/GM Diesel LL B-025<br>※25L缶そのままでの配送となりますので、運送中による多少のキズ・へこみ等はご了承下さい。　※画像はイメージです。 <br>４ストロークエンジン用（ガソリン・ディーゼル） <br>　<br>ケミカル系/エンジンオイル<tr><td colspan="2">
